import React from "react";
import {
  StyleSheet,
  View,
  Text,
  ImageBackground,
  Image,
  Linking,
} from "react-native";

const Contact = () => {
  return (
    <ImageBackground
      source={require("../assets/background.png")}
      style={{ width: "100%", height: "100%" }}
    >
      <View style={styles.container}>
        <View style={styles.title}>
          <Text
            style={{
              fontSize: 24,
              textAlign: "center",
              paddingBottom: "2%",
              color: "white",
              fontWeight: "bold",
            }}
          >
            Contact Us
          </Text>
          <Text style={styles.text}>
            University of Florida College of Design, Construction and Planning
            {"\n"}
            {"\n"}
            Address: Architecture Building, 1480 Inner Road, Gainesville, FL
            32611{"\n"}
            Phone Number: (352) 392-4836{"\n"}
            Fax: (352) 392-7266{"\n"}
            ======================= ADD MORE INFO==========================
          </Text>
          <Text style={styles.text}>Connect:</Text>
          <Text
            style={styles.text}
            onPress={() => {
              Linking.openURL("https://instagram.com/ufdcp/");
            }}
          >
            Instagram
          </Text>
        </View>
      </View>
    </ImageBackground>
  );
};

const styles = StyleSheet.create({
  container: {
    height: "100%",
    marginLeft: "7%",
    marginRight: "7%",
  },
  title: {
    height: "10%",
    paddingTop: "10%",
  },
  text: {
    color: "white",
    fontWeight: "bold",
    paddingBottom: "2%",
  },
});

export default Contact;
